import logo from './logo.svg';
import './App.css';
import axios from 'axios'
import { render } from '@testing-library/react';
class App extends Component{
  state = {
    dataResponse : []
  }
  componentDidMount() {
    fetch('http://simple.ripley.cl/api/v2/products?format=json&partNumbers=2000379450763',{mode: 'cors'})
      .then(res => res.json())
      .then(data => this.setState({todos : data}))
  }
  render(){
    return (
      <div className="App">
        <header className="App-header">
          <p>
            aca iria el nombre<br></br>
            {this.state.dataResponse.name}
          </p>
        </header>
      </div>
    );
    }
}

export default App;
